import Header from "../Header";

const Products = () => {
  return (
    <>
      <Header />

      <div>
        <img
          src="https://assets.ccbp.in/frontend/react-js/nxt-trendz-products-img.png"
          alt="products"
        />
      </div>
    </>
  );
};

export default Products;
